export async function getBalance(userID) {
  //console.log(userID);
  const { data, error } = await supabase
    .from("user_data")
    .select("*")
    .eq("user_id", userID);
  if (error) {
    console.log(error);
    return -1;
  }
  return data[0]?.balance ?? -1;
}


